import React,{useState} from 'react';
import { Link } from 'react-router-dom';
import './Header.css';
import Axios from 'axios';


const Header2 = () => {
 
  const [data, setData] = useState(null);

  const getUser = () => {
    Axios({
      method: "GET",
      withCredentials: true,
      url: "http://localhost:4000/user",
    }).then((res) => {
      setData(res.data);
      console.log(res.data);
    });
  };
    
  return(
      <div class="Header">
            <h1>Lingo<span>Peer</span></h1>
            <nav>
                <ul>
                  <Link to="/apresConn">
                  <li>Home</li>
                  </Link>
                  <Link to="/Conn">
                  <li>AboutUs</li>
                  </Link>
                  <Link to="/Conn">
                  <li>Contact Us</li>
                  </Link>
                </ul>
            </nav>
            <Link to="/Profile">
            <button id="utilisateurBTN"onclick >{data.username}</button>
            </Link>
      </div>

    );
}
export default Header2;
